import React from "react";
import {NavLink} from "react-router-dom";
import axios from "axios";
import {Card, CardContent, CardHeader, CardMedia} from "@material-ui/core";


function Navbar(){
    async function getInfo() {
        axios.get("https://api.nytimes.com/svc/topstories/v2/us.json?api-key=XxbWXs3gfJ27rp7UpTF648NqcF2Xp39x")
            .then(response =>{
                console.log(response.data);
            }).catch(function (error){
            console.log(error)
        });
    }
    return(
        <div className={"navbar"}>
            <Card className={"navCard"} style={{backgroundColor: "#5D8598", borderRadius: 25}}>
                <CardContent>
                    <h3 className={"naviMenuTitle"}>Menu</h3>

                    <ul className={"menuList"}>
                        <li className={"listItem"}><NavLink to={"/blogone"} className={"naviLink"}>Introduction</NavLink></li>
                        <li className={"listItem"}><NavLink to={"/blogtwo"} className={"naviLink"}>A Fight Between Myself, My Thoughts...</NavLink></li>
                        <li className={"listItem"}><NavLink to={"/blogthree"} className={"naviLink"}>Blog Three</NavLink></li>
                        {/*<li className={"listItem"}><NavLink to={"/"}>BlogTwo</NavLink></li>*/}
                    </ul>
                </CardContent>
            </Card>

        </div>
    )
}

export default Navbar;
